import { clients } from "./data";
export default function Clientf() {
    return (
        clients.filter(function(client){
            return client.montant>3000
        }).map(function(client){
            return(
                <>
                    <p>{client.nom }</p>
                    <p>{client.montant}</p>
                </>
            )
        })
    )
}
